// import logo from "./logo.svg";
import React, { useState } from "react";
import "antd/dist/antd.min.css";
import "bootstrap/dist/css/bootstrap.min.css";
import "./App.css";
// import Home from "./Todo/Home";
import { Routes, Route } from "react-router-dom";
import Curd from "./todo/Curd";
import Edit from "./todo/Edit";
import View from "./todo/View";
// import Home from "./todo/Home";
import Add from "./todo/Add";
import Service from "./todo/Service";
import Contect from "./todo/Contect";
import Login from "./Login/Login";
import Todo from "./todo/Todo";
import Protected from "./Login/Protected.jsx";

// import AddTodo from "./Todo/AddTodo";

function App() {
  return (
    <>
      <Routes>
        <Route
          exact
          path="/"
          redirectTo="/login"
          athMatch="full"
          element={<Login />}
        />

        {/* <Route path=""  element={<Login />} /> */}
        <Route path="/todo" element={ <Protected>
              <Todo />
            </Protected>} />
        <Route path="/service" element={ <Protected>
              <Service />
            </Protected>} />
        <Route path="/contect" element={ <Protected>
              <Contect />
            </Protected>} />
        <Route
          path="/curd"
          element={
            <Protected>
              <Curd />
            </Protected>
          }
        />
        <Route path="/add" element={ <Protected>
              <Curd />
            </Protected>} />
        <Route path="/edit/:id" element={ <Protected>
              <Curd />
            </Protected>} />
        <Route path="/view/:id" element={ <Protected>
              <Curd />
            </Protected>} />
      </Routes>
    </>
  );
}

export default App;
